import React from 'react';
import './Header.css';


const renderedLinks = () => {
  return (
    <div className="LinkGrid">
      <a href={'1'}>Home</a>
      <a href={'2'}>Shop Info</a>
      <a href={'3'}>About Us</a>
      <a href={'4'}>Customer Gallery</a>
    </div>
  )
}

const Header = () => {
  return (
    <div className="Header">
      <div className="Grid">
        <div className="Logo"><img src="logo.png"></img></div>
        <nav className="NavLinks">{renderedLinks()}</nav>
        <div className="ActionButton"><button>Call Now</button></div>
      </div>
    </div>
  );
}

export default Header;
